def solver(grid):
    from collections import Counter, defaultdict
    import bisect

    H = len(grid)
    W = len(grid[0]) if H else 0
    out = [row[:] for row in grid]
    if H == 0 or W == 0:
        return out

    # Background = most frequent color
    counts = Counter()
    for row in grid:
        counts.update(row)
    bg = max(counts, key=counts.get)

    # Collect all non-background cells, grouped by anti-diagonal id u = r + c
    by_u = defaultdict(list)
    for r in range(H):
        for c in range(W):
            if grid[r][c] != bg:
                by_u[r + c].append((r, c))

    if not by_u:
        return out

    # Split each u-diagonal into contiguous segments (step (r+1, c-1))
    # For each segment, store (u, vmin, vmax) where v = c - r, treated as continuous interval.
    segments = []
    for u, coords in by_u.items():
        coords.sort(key=lambda rc: rc[0])  # sort by row
        seg = [coords[0]]
        for r, c in coords[1:]:
            pr, pc = seg[-1]
            if r == pr + 1 and c == pc - 1:
                seg.append((r, c))
            else:
                vs = [cc - rr for rr, cc in seg]
                segments.append((u, min(vs), max(vs)))
                seg = [(r, c)]
        vs = [cc - rr for rr, cc in seg]
        segments.append((u, min(vs), max(vs)))

    # For each v (slope +1 diagonal, v = c - r), collect which u-boundaries are present
    min_v = -(H - 1)
    max_v = W - 1
    active_u_by_v = defaultdict(set)
    for u, vmin, vmax in segments:
        if vmax < min_v or vmin > max_v:
            continue
        v_start = max(vmin, min_v)
        v_end = min(vmax, max_v)
        for v in range(v_start, v_end + 1):
            active_u_by_v[v].add(u)

    active_sorted = {v: sorted(us) for v, us in active_u_by_v.items() if us}

    fill = 2
    for r in range(H):
        for c in range(W):
            if grid[r][c] != bg:
                continue
            v = c - r
            us = active_sorted.get(v)
            if not us or len(us) < 2:
                continue
            u = r + c
            i = bisect.bisect_left(us, u)
            if 0 < i < len(us) and us[i - 1] < u < us[i]:
                out[r][c] = fill

    return out
